import React, { Component } from 'react';

class Header extends React.Component{
  constructor(props) {
    super(props)
  }
  render(){
      return(
        <div>
          {
            this.props.projectsName && this.props.projectsName.map((project, i)=>{
                return (
                        <li key={i}>
                          <object width="400" height="400" data={project}>
                            </object>
                        </li>
                      )
              })
          }
        </div>
      )
  }
}

export default Header;
